Would you like to win your dream wedding at Boomrock? Come along to the Wellington Wedding Show on Sunday May 2nd to be in the draw. The prize includes your ceremony, your reception, your photographer, your gown, your flowers and so much more. We are super excited to see the look on the faces of the lucky winners when the prize draw takes place on May 15th at Boomrock! 
Details about the prize can be found at www.landing.boomrock.co.nz
